import { Component } from "react";
import { Menu, Dropdown } from "antd";
import { useNavigate } from "react-router-dom";
import "./index.css";

class Home extends Component {

    returnBook = () => {
        console.log("归还书籍");
    }

    borrowBook = () => {
        console.log("借阅书籍");
    }

    presonCenter = () => {
        console.log("个人中心");
        const { navigate } = this.props;

        console.log(navigate);
        navigate('/person');
    }

    render() {
        const {
            returnBook, borrowBook, presonCenter
        } = this;

        return (
            <div className="back">
                <div className="top-left">图书管理系统</div>
                <div className="top-person">
                    <Dropdown
                        placement="topLeft"
                        overlay={
                        <Menu style={{ color: "red"}}>
                            <Menu.Item
                                className="menu-item"
                                key="1"
                                onClick={borrowBook}
                            >
                                借阅书籍
                            </Menu.Item>
                            <Menu.Item 
                                className="menu-item"
                                key="2"
                                onClick={returnBook}
                            >
                                归还书籍
                            </Menu.Item>
                            <Menu.Item 
                                className="menu-item"
                                key="3"
                                onClick={presonCenter}
                            >
                                个人中心
                            </Menu.Item>
                        </Menu>
                        }
                        trigger="hover"
                    >
                        <p>用户名</p>
                    </Dropdown>
                </div>
            </div>
        )
    }
}

export default function(props) {
    const navigation = useNavigation();

    return <Home {...props} navigation={navigation} />;
}
